import React from "react";

const TransactionsList = ({ transaction }) => {
  return (
    <>
      {!Array.isArray(transaction) && (
        <>
          <div>{transaction.description}</div>
          <div>{transaction.amount}</div>
        </>
      )}
    </>
  );
};

export default TransactionsList;
